        [UxmlAttribute]
        [CreateProperty]
        public string IconName
        {
            get
            {
                return icon != MatIcon.None && enumToName.TryGetValue(icon, out var iconName) ? iconName : string.Empty;
            }

            set
            {
                Icon = (!string.IsNullOrEmpty(value) && nameToEnum.TryGetValue(value, out var enumValue)) ? enumValue : MatIcon.None;
            }
        }

        [UxmlAttribute]
        [CreateProperty]
        public MatIcon Icon
        {
            get
            {
                return icon;
            }

            set
            {
                icon = value;
                text = unicodes.TryGetValue(value, out string unicode) ? $"\\u{unicode}" : string.Empty;
            }
        }

        public NuiIconMat() : base()
        {
            AddToClassList("nui-mat-icon");
